                className="px-6 py-3 bg-[#128C3B] text-white font-bold rounded-lg hover:bg-[#0f7330] transition transform hover:scale-105"
              >
                ‚Üê ‡∏Å‡∏•‡∏±‡∏ö‡πÑ‡∏õ‡πÄ‡∏•‡∏∑‡∏≠‡∏Å‡∏£‡∏ñ
